  \"2013-03-15T22:28:07.961894\",\n\t\"name\": \"texas-well-header-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides simple features that
  report basic information describing a simple or complex borehole. Published by the
  Arizona Geological Survey as a  web feature service, a web map service, and as an
  ESRI service  for the National Geothermal Data System. Wells with multiple well
  bores may have separate records (rows) for each well bore, each with a distinct
  HeaderURI (record identifier); in this case, the ParentWellURI should provide the
  HeaderURI representing the well. If multiple data items are associated with a single
  well header, the multiple values are concatenated in a single text field using '|'
  as a delimiter. Borehole type is factored into 4 facets-- commodity of interest,
  well function, well status, and production result.\",\n\t\"license_title\": null,\n\t\"extras\":
